const DiaryList = ({ diaryList }) => {
  return (
    <div className='DiaryList'>
      <h2>식단 일기 리스트</h2>
      <h4>{diaryList.length} 개의 식단 일기가 있습니다.</h4>
      <div>
        {diaryList.map((it) => (
          <div key={it.id}>
            <div>작성자: {it.author} </div>
            <div>식단: {it.content}</div>
            <div>운동 시간: {it.exercise}</div>
            <div>작성 시간(ms): {it.created_date}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DiaryList;
